INSERT INTO `content` VALUES (327, 2061, 1, 'About', 'We set out with a simple goal: create the design and products that we would like to see.', '<p>We are a group of highly effective, passionate people ready to take your product to the next level. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae taque earum hic tenetur a sapiente delectus ut aut reiciendis.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-08-09 14:53:03', '2020-08-09 14:53:03', 'a1e38f82-68ee-4316-8370-46dec1f9be0e');
INSERT INTO `content` VALUES (328, 2072, 1, 'How It’s Made', 'From conception to perfection, we Craft each one of our digital products by hand.', '<p>Some studios have a secret or complex process on how they create great work. Ours is not a secret and it\'s very simple: <strong>Truth.</strong> Here at Happy Lager we believe that every digital product we make speaks to the integrity of our craft. We want to use great products, <strong>so we only create great products</strong>.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-08-09 14:53:04', '2020-08-09 14:53:04', '624e21c8-2b3c-4f6e-830a-4f8d1d83a367');
INSERT INTO `content` VALUES (329, 2073, 1, 'What’s On Tap', 'Every digital product has a story to tell. It’s our job to find it and tell it well.', '<p>While we were not meaning to rhyme, this statement holds true. The end goal is to connect with humans, and we use the basic principles of story to do just that. Browse our work, enjoy the visuals and discover what it takes to create something great.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-08-09 14:53:04', '2020-08-09 14:53:04', '939c5bf6-593a-4901-aa79-baf3a926b656');
